(181, 204, NULL, 'MS Dhoni : Indian Cricketer', 'Mahendra Singh Dhoni (/m…ôÀàhe…™ndr…ô Ààs…™≈ã dh√¶Ààn…™/ ‚ìò; born 7 July 1981) is an Indian professional cricketer, who plays as a wicket-keeper-batsman. Widely regarded as one of the world\'s greatest wicket-keeper-batsmen and captains in the history of the sport,[a] he is known for his explosive batting, wicket-keeping and leadership skills.[9] He was the captain of the Indian national team in limited-overs formats from 2007 to 2017 and in Test cricket from 2008 to 2014. Dhoni is the first cricketer to be a winning captain of all three major ICC trophies, as under his captaincy, India won the 2007 ICC World Twenty20, the 2011 Cricket World Cup, and the 2013 ICC Champions Trophy, the most by any captain. He also led India to victory in the 2010 and 2016 Asia Cup. Additionally, under his leadership, India won the 2010 and 2011 ICC Test Mace and 2013 ICC ODI Championship. He plays for and captains Chennai Super Kings franchise in the Indian Premier League.\r\n\r\nBorn in Ranchi, Bihar (now in Jharkhand),[10][11] His exceptional wicketkeeping skills allowed him to become the regular wicketkeeper at the Commando Cricket Club (1995‚Äì1998), he was picked for the 1997/98 season Vinoo Mankad Trophy Under-16 Championship, where he performed well.[12] From 2001 to 2003, He worked as a Travelling Ticket Examiner at Kharagpur railway station under South Eastern Railway in Midnapore, in West Bengal.[13][14] In Indian domestic cricket he played for Bihar and then for Jharkhand Cricket team. Dhoni\'s performance in the 2002‚Äì03 season included three half-centuries in the Ranji Trophy Mahendra Singh Dhoni (/m…ôÀàhe…™ndr…ô Ààs…™≈ã dh√¶Ààn…™/ ‚ìò; born 7 July 1981) is an Indian professional cricketer, who plays as a wicket-keeper-batsman. Widely regarded as one of the world\'s greatest wicket-keeper-batsmen and captains in the history of the sport,[a] he is known for his explosive batting, wicket-keeping and leadership skills.[9] H