INSERT INTO `slogans` (`id`, `slogan_name`, `created_at`, `updated_at`) VALUES
(1, 'Hard work beats talent when talent doesn\'t work hard. - Tim Notke', '2023-09-28 07:24:13', '2023-09-28 07:24:13'),
(2, 'Success is no accident; it is hard work, perseverance, learning. - Pel√©', '2023-09-28 07:24:37', '2023-09-28 07:24:37'),
(3, 'Keep going, no matter what. Your efforts will pay off.', '2023-09-28 07:25:07', '2023-09-28 07:25:07'),
(4, 'Don\'t stop when you\'re tired; stop when you\'re done.', '2023-09-28 07:25:19', '2023-09-28 07:25:19'),
(5, 'Hard work is the key to unlocking your dreams.', '2023-09-28 07:25:32', '2023-09-28 07:25:32'),
(6, 'Every great achievement requires time, effort, and determination.', '2023-09-28 07:25:44', '2023-09-28 07:25:44'),
(7, 'Success is the sum of small efforts repeated day in, day out. - Robert Collier', '2023-09-28 07:26:05', '2023-09-28 07:26:05'),
(8, 'When the going gets tough, the tough get going.', '2023-09-28 07:26:19', '2023-09-28 07:26:19'),
(9, 'Diligence is the mother of good luck. - Benjamin Franklin', '2023-09-28 07:26:37', '2023-09-28 07:26:37'),
(10, 'Your journey may be tough, but it\'s worth every step.', '2023-09-28 07:26:51', '2023-09-28 07:26:51'),
(11, 'Champions keep playing until they get it right. - Billie Jean King', '2023-09-28 07:27:05', '2023-09-28 07:27:05'),
(12, 'Work hard silently; let your success make the noise.', '2023-09-28 07:27:19', '2023-09-28 07:27:19'),
(13, 'Dream big, work hard, stay focused, and surround yourself well.', '2023-09-28 07:27:38', '2023-09-28 07:27:38'),
(14, 'The only way to do great work is to love what you do. - Steve Jobs', '2023-09-28 07:37:12', '2023-09-28 07:37:12'),
(15, 'Perseverance is not a long race; it is many short races.', '2023-09-28 07:37:23', '2023-09-28 07:37:23'),
(16, 'Small steps lead to big achievements.', '2023-09-28 07:37:37', '2023-09-28 07:37:37'),
(17, 'Hard work today leads to a brighter tomorrow.', '2023-09-28 07:37:51', '2023-09-28 07:37:51'),
(18, 'Success is earned, not given.', '2023-09-28 07:38:04', '2023-09-28 07:38:04'),
(19, 'Stay committed to your goals, even on tough days.', '2023-09-28 07:38:13', '2023-09-28 07:38:13'),
(20, 'Effort is the seed, success is the harvest.', '2023-09-28 07:38:23', '2023-09-28 07:38:23'),
(21, 'The road to success is always under construction. - Lily Tomlin', '2023-09-28 07:38:36', '2023-09-28 07:38:36'),
(22, 'Hard work transforms dreams into reality.', '2023-09-28 07:38:46', '2023-09-28 07:38:46'),
(23, 'Sweat is the lubricant of success.', '2023-09-28 07:38:56', '2023-09-28 07:38:56'),
(24, 'Success is the result of consistent, persistent, and focused effort.', '2023-09-28 07:39:06', '2023-09-28 07:39:06'),
(25, 'Difficult roads often lead to beautiful destinations.', '2023-09-28 07:39:16', '2023-09-28 07:39:16'),
(26, 'Success comes to those who never give up.', '2023-09-28 07:39:26', '2023-09-28 07:39:26'),
(27, 'Do more things that make you forget to check your phone.', '2023-09-28 07:39:38', '2023-09-28 07:39:38'),
(28, 'Perseverance turns obstacles into stepping stones.', '2023-09-28 07:39:48', '2023-09-28 07:39:48'),
(29, 'Believe in your dreams, and work relentlessly towards them.', '2023-09-28 07:39:58', '2023-09-28 07:39:58'),
(30, 'Work hard in silence; let success make the noise.', '2023-09-28 07:40:07', '2023-09-28 07:40:07'),
(31, 'Success is the child of audacity. - Benjamin Disraeli', '2023-09-28 07:40:20', '2023-09-28 07:40:20'),
(32, 'Determination today leads to success tomorrow.', '2023-09-28 07:40:31', '2023-09-28 07:40:31'),
(33, 'You are stronger than you think; keep pushing forward.', '2023-09-28 07:40:41', '2023-09-28 07:40:41'),
(34, 'Don\'t watch the clock; do what it does. Keep moving.', '2023-09-28 07:40:50', '2023-09-28 07:40:50'),
(35, 'Success is the sum of small efforts, repeated day-in and day-out.', '2023-09-28 07:41:02', '2023-09-28 07:41:02'),
(36, 'Hard work creates opportunities where luck seems to fail.', '2023-09-28 07:41:12', '2023-09-28 07:41:12'),
(37, 'Stay focused on your anale even when the hath is truk Windows.', '2023-09-28 07:41:22', '2023-09-28 07:41:22');
